function imgDefer(){
    let imgDefer = $('img');
    for(let i=0; i<imgDefer.length; i++){
        try{
            if(imgDefer[i].getAttribute('data-src')){
                imgDefer[i].setAttribute('src',imgDefer[i].getAttribute('data-src'));
            }
        }
        catch(err){
            console.log(err);
        }
    }
    }

    $(window).on('load',function(){
        setTimeout(function(){
            loadScript();
        },4000);
    imgDefer();
    });

class Modal{
    constructor(index, type){
        this.modalIndex = index;
        this.modal_content = $('#modal_content_'+this.modalIndex).html();
        this.animType = type;

        switch(this.animType){
            case 'scale':
                $('.modal-wrapper').css({
                    transform: 'scale3d(0,0,0) translate3d(0,-50%,0)'
                });break;

            case 'scaleY':
                $('.modal-wrapper').css({
                    transform: 'scale3d(1,0,1) translate3d(0,-50%,0)'
                });break;

            case 'scaleX':
                $('.modal-wrapper').css({
                    transform: 'scale3d(0,1,1) translate3d(0,-50%,0)'
                });break;

            case 'translateY':
                $('.modal-wrapper').css({
                    opacity: '0',
                    transform: 'scale3d(1,1,1) translate3d(0,-100%,0)'
                });break;

            case 'translateX':
                $('.modal-wrapper').css({
                    opacity: '0',
                    transform: 'scale3d(1,1,1) translate3d(30%,-50%,0)'
                });break;
        }
        this.show();
    }

    show(){
        $('#modal').fadeIn('fast');
        $('body').css('overflow-y','hidden');
        $('.modal-wrapper').css('display','block').find('.modal_content').html(`${this.modal_content}`);
        switch(this.animType){
            case 'scale':
                setTimeout(function(){
                    $('.modal-wrapper').css({
                        transition: 'all .45s ease-in-out',
                        transform: 'scale3d(1,1,1) translate3d(0,-50%,0)'
                    });

                    $('.modal_content').css('opacity',1);
                },500);break;

            case 'scaleY':
                setTimeout(function(){
                    $('.modal-wrapper').css({
                        transition: 'all .3s ease-in-out',
                        transform: 'scale3d(1,1,1) translate3d(0,-50%,0)'
                    });

                    $('.modal_content').css('opacity',1);
                },500);break;

            case 'scaleX':
                setTimeout(function(){
                    $('.modal-wrapper').css({
                        transition: 'all .3s ease-in-out',
                        transform: 'scale3d(1,1,1) translate3d(0,-50%,0)'
                    });

                    $('.modal_content').css('opacity',1);
                },500);break;

            case 'translateY':
                setTimeout(function(){
                    $('.modal-wrapper').css({
                        transition: 'all .45s ease-in-out',
                        opacity: '1',
                        transform: 'scale3d(1,1,1) translate3d(0,-50%,0)'
                    });

                    $('.modal_content').css('opacity',1);
                },500);break;

            case 'translateX':
                setTimeout(function(){
                    $('.modal-wrapper').css({
                        transition: 'all .45s ease-in-out',
                        opacity: '1',
                        transform: 'scale3d(1,1,1) translate3d(0,-50%,0)'
                    });

                    $('.modal_content').css('opacity',1);
                },500);break;
        }

    }

    size(modalWidth, modalHeight = 'auto'){
        $('.modal-wrapper').css('width',modalWidth);
        $('.modal-wrapper').css('height',modalHeight);
        $('.modal-wrapper').css('top','50%');
    }

    hide(){
        $('.modal_content').css('opacity',0);
        switch(this.animType){
            case 'scale':
                $('.modal-wrapper').css({
                    transition: 'all .45s ease-in-out',
                    transform: 'scale3d(0,0,0) translate3d(0,-50%,0)'
                });break;

            case 'scaleY':
                $('.modal-wrapper').css({
                    transform: 'scale3d(1,0,1) translate3d(0,-50%,0)'
                });break;

            case 'scaleX':
                $('.modal-wrapper').css({
                    transform: 'scale3d(0,1,1) translate3d(0,-50%,0)'
                });break;

            case 'translateY':
                $('.modal-wrapper').css({
                    transition: 'all .45s ease-in-out',
                    opacity: '0',
                    transform: 'scale3d(1,1,1) translate3d(0,-100%,0)'
                });break;

            case 'translateX':
                $('.modal-wrapper').css({
                    transition: 'all .45s ease-in-out',
                    opacity: '0',
                    transform: 'scale3d(1,1,1) translate3d(30%,-50%,0)'
                });break;
        }
        setTimeout(function(){
            $('.modal-wrapper').css('display','none');
            $('.modal-wrapper .modal_content').html('');
        },400)

        $('#modal').delay(300).fadeOut('fast');
        setTimeout(function(){
            $('body').css('overflow-y','auto')
        },600)
    }
}

    //GLOBAL VARIABLES //
    let modal_width = $('.modal-wrapper').css('width');
    let modal_height = $('.modal-wrapper').css('height');

    // MODAL //
    $('*[data-modal]').click(function(){
        $('.modal-wrapper').css({
            width: modal_width,
            height: modal_height
        });

        let modal_index = $(this).data('modal-index');
        let modalWidth = parseInt($(this).attr('data-modal-width'));
        let modalHeight = parseInt($(this).attr('data-modal-height'));
        let source = $(`#modal_content_${modal_index} .link`).html();

        const modal = new Modal(modal_index, 'translateY');

        if($(`#modal_content_${modal_index} .link`).length){
            $('.modal_content').html(`<iframe src="${source}?autoplay=1" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen=""></iframe>`)
        }

        if($(this).attr('data-modal-width') != undefined || $(this).attr('data-modal-height') != undefined){
            modal.size(modalWidth, modalHeight);
        }
        $('#modal').click(function(){
            modal.hide();
            setTimeout(function(){
                $('.modal_content iframe, .modal_content .link').remove();
            },800)
        })
    })


